function add(n1, n2) {
    return n1 + n2;
}

function subs(n1,n2) {
    return n1 - n2;
}

function multi(n1,n2) {
    return n1 * n2;
}

function div(n1,n2) {
    if(n2 == 0){
        return 'can not divide any number with 0 ';
    }
    else{
        return (n1 / n2).toFixed(2);
    }
}

export {add, subs, multi, div};
